import React from "react";
import { Link } from "react-router-dom";
import Linkify from "react-linkify";

import Smileys from "./Smileys";
import { Shake, ShakeHard, ShakeHorizontal } from "reshake";
const Experience = () => {
  const placesWhereIWorked = [
    {
      name: "CCCCCompany",
      city: "Barcelona",
      country: "Spain",
      jobTitle: "Things",
      jobDescription:
        "Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua",
      jobStarted: "2017",
      jobEnded: ""
    },
    {
      name: "company",
      city: "Madrid",
      country: "Spain",
      jobTitle: "gellosda",
      jobDescription:
        "Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua",
      jobStarted: "2015",
      jobEnded: "2017"
    }
  ];

  return (
    <div className="">
      <p className="aboutparagraph">
        {" "}
        <Shake
          h={5}
          v={5}
          r={3}
          dur={70}
          int={1.6}
          max={15}
          fixed={true}
          fixedStop={false}
          freez={false}
          display="none"
        >
          <a href="https://github.com/tasti/react-linkify/">
            https://github.com/tasti/react-linkify/
          </a>
        </Shake>{" "}
        See source code at . most often go by Calle. He is currently getting his
        M.F.A in Graphic Design from Rhode Island School of design, and is
        expected to graduate in 2020. Calle likes to work with difficult
        interfaces that can strengthen the relation between user and content. He
        has recently gained an interest in graphic design for the web. This
        website is built with react. It still has some glitches, but will get
        better as Calle improves is coding skills.
      </p>
      {placesWhereIWorked.map((eachPlace, index) => {
        return (
          <div className="experience-content" key={index}>
            {/* <h3>{eachPlace.name}</h3>
            <p>
              {eachPlace.city}, {eachPlace.country}
            </p>
            <h4>{eachPlace.jobTitle}</h4>
            <p>{eachPlace.jobDescription}</p>
            <p>
              {eachPlace.jobStarted} - {eachPlace.jobEnded || "current"}
            </p> */}
          </div>
        );
      })}
    </div>
  );
};

export default Experience;
